import React, {Component} from 'react'
import Slider from 'react-slick';

export default class MainBanner extends Component{
    render() {
      const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
      };
      return (
        <div>
          <h2> Single Item</h2>
          <Slider {...settings}>
		    <div class="slide_content1">1</div>
		    <div class="slide_content2">2</div>
		    <div class="slide_content3">3</div>
          </Slider>
        </div>
      );
    }
}
